import os
os.getcwd()

# Import required modules:
# arrange an instance seg. model for test
from sahi.utils.yolov5 import (
    download_yolov5s6_model,
)

# import required functions, classes
from sahi.model import Yolov5DetectionModel
from sahi.utils.cv import read_image
from sahi.utils.file import download_from_url
from sahi.predict import get_prediction, get_sliced_prediction, predict
from IPython.display import Image

# Download yolov5 model and two test images:
# download YOLOV5S6 model to 'models/yolov5s6.pt'
yolov5_model_path = 'models/yolov5s6.pt'
download_yolov5s6_model(destination_path=yolov5_model_path)

# download test images into demo_data folder
download_from_url('https://raw.githubusercontent.com/obss/sahi/main/demo/demo_data/small-vehicles1.jpeg', 'demo_data/small-vehicles1.jpeg')
download_from_url('https://raw.githubusercontent.com/obss/sahi/main/demo/demo_data/terrain2.png', 'demo_data/terrain2.png')

# Standard inference with a yolov5 model
# Instantiate a detection model by defining model weight path and other parameters
detection_model = Yolov5DetectionModel(
    model_path=yolov5_model_path,
    confidence_threshold=0.3,
    device="cpu", # or 'cuda:0'
)

# Perform prediction by feeding the get_prediction function with an image path and a DetectionModel instance:
result = get_prediction("demo_data/small-vehicles1.jpeg", detection_model)

# Visualize predicted bounding boxes and masks over the original image:
result.export_visuals(export_dir="demo_data/")

Image("demo_data/prediction_visual.png")

# Sliced inference with a yolov5 Model
# To perform sliced prediction we need to specify slice parameters. In this example I will perform prediction over slices of 256x256 with an overlap ratio of 0.2:
result = get_sliced_prediction(
    "demo_data/small-vehicles1.jpeg",
    detection_model,
    slice_height = 256,
    slice_width = 256,
    overlap_height_ratio = 0.2,
    overlap_width_ratio = 0.2
)

# Visualize predicted bounding boxes and masks over the original image:
result.export_visuals(export_dir="demo_data/")

Image("demo_data/prediction_visual.png")

# Prediction Result
object_prediction_list = result.object_prediction_list

object_prediction_list[0]

result.to_coco_annotations()[:3]

result.to_coco_predictions(image_id=1)[:3]

